import React from "react";

export default function Contact() {
  return (
    <div>
      {/* First Section */}
      <div className="flex flex-col justify-start space-y-2 mt-20 pl-12 items-start">
        <span className="text-8xl">Nous joindre</span>
        <span className="text-3xl">Prenons un caf√©</span>
      </div>
      {/* Contact */}
      <div className="flex w-full mt-44">
        <div className="flex flex-col">
          <div className="flex flex-col text-lg">
            <span>Nous envoyez un mail</span>
            <span>Contact@caauri.com</span>
          </div>
        </div>
        <div></div>
      </div>
    </div>
  );
}
